const App=()=> {
  return (
    <div>
      <Header />
      <h1 className="blue">Homepage</h1>
      <p style= {{backgroundColor:"red"}}> This a homepage</p>
      <Contact />
      <Footer />
    </div>

  );
}

export default App;
